import "./styles.scss";
import { serialize, deserialize } from "./serialize";
import { offsetTime } from "./time";

const offset = {
  seconds: 0,
  minutes: 0,
  // hours: 2,
  // days: 1,
  weeks: 3,
  months: 8,
  years: 0
};

function processInput(input) {
  const save = deserialize(input);

  const idleEntry = JSON.parse(save.o[0]);
  const newTimestamp = offsetTime(idleEntry.timestamp, offset);
  idleEntry.timestamp = newTimestamp;
  save.o[0] = JSON.stringify(idleEntry);

  const saveString = serialize(save);
  return saveString;
}

async function initPage() {
  // const testTxt = "hello world 2";
  // await navigator.clipboard.writeText(testTxt);
  // const perms = await navigator.permissions.query({name: "clipboard-read"})
  // console.log(perms)

  const inputForm = document.getElementById("saveInputForm");
  const outputForm = document.getElementById("saveOutputForm");
  const inputField = document.getElementById("saveInputField");
  const inputFormErrorField = document.getElementById(
    "saveInputFormErrorField"
  );
  const outputField = document.getElementById("saveOutputField");
  const copyButton = document.getElementById("copyOutputButton");

  inputField.onchange = (event) => {
    const fieldValue = inputField.value;
    try {
      const processedValue = processInput(fieldValue);
      outputField.value = processedValue;
      inputForm.classList.remove("error");
      inputFormErrorField.innerText = "";
    } catch (e) {
      inputForm.classList.add("error");
      inputFormErrorField.innerText = `Error: ${e}`;
      outputField.value = "";
    }
  };

  copyButton.onclick = (event) => {
    event.preventDefault();
    // console.log("button clicked");
    navigator.clipboard.writeText(outputField.value);
  };
}

